("107","chat_setting_info","","Enable chat system to chat with friends on the buttom of the page","فعل نظام الدردشة للدردشة مع الإصدقاء في يمين أسفل الصفحة.","Enable chat system to chat with friends on the buttom of the page","Activer système chat pour discuter avec des amis sur le fond de la page","Aktiviere das Chatsystem zum chatten mit Freunden","Attivare il sistema chat per chiacchierare con gli amici in fondo alla pagina","Ativar sistema de chat para conversas com seus amigos no rodap&amp;eacute; da p&amp;aacute;gina","Включить чат системы для общаться с друзьями на дне страницы","Habilitar cache de chat, para hablar con amigos al pie del sitio","Sayfanın altındaki arkadaşlarınızla sohbet etmek için sohbet sistemini etkinleştirme","启用聊天系统与页面底部的好友聊天"),
