("418","welcome_wonder_text","","Wonder (NEW), ability to wonder a post if you don&#039;t like it.","تعجب (جديد), ميزة جديدة تستطيع من خلالها التعجب بل المنشورات.","Wonder (NEW), de mogelijkheid om een bericht af of je niet bevalt.","Wonder (NOUVEAU), la capacité à se demander un poste si vous ne l&#39;aimez pas.","(NEU) Wundern, die Möglichkeit, einen Beitrag zu markieren, in Frage zu stellen, weil Du es nicht glaubst oder verstehst.","Wonder (NEW), capacità di stupirsi un post, se non ti piace.","N&amp;atilde;o curtir (NEW), abilidade para N&amp;atilde;o curtir um post.","Свободно и без ограничений, делитесь своими публикациями со всем миром.","Libre y sin restricciones, asombroso para compartir tus publicaciones en todo el mundo.","Eğer beğenmezseniz bir yazı merak (YENİ), yetenek Wonder.","Wonder (NEW), 如果你不喜欢一个帖子,你可以怀疑它"),
("419","welcome_connect_text","","Connect with your family and friends and share your moments.","تواصل مع عائلتك وأصدقائك شارك اللحظات الخاصة بك.","Verbinden met je familie en vrienden en deel je momenten.","Connectez-vous avec votre famille et vos amis et partager vos moments.","Ein modernes soziales Netzwerk für den Kontakt zu Deiner Familie und Freunden.","Connettiti con la tua famiglia e gli amici e condividere i tuoi momenti.","Conecte com seus amigos e fam&amp;iacute;lia, e compartilhe seus momentos.","Общайтесь с вашей семьей и друзьями, поделитесь своими лучшими моментами.","Conéctate con tu familia y amigos para compartir los mejores momentos.","Aileniz ve arkadaşlarınızla bağlamak ve anları paylaşmak.","与您的家人和朋友联系并分享您的时刻"),
