("421","welcome_discover_text","","Discover new people, create new connections and make new friends.","إكتشف أشخاص جدد، وأنشىء اتصالات جديدة وكون صداقات جديدة.","Ontdek nieuwe mensen, nieuwe verbindingen te maken en nieuwe vrienden maken.","Découvrez de nouvelles personnes, créer de nouvelles connexions et de faire de nouveaux amis.","Entdecke neue Leute, neue Verbindungen und neue Freunde.","Scoprire nuove persone, creare nuove connessioni e fare nuove amicizie.","Descubra novas pessoas, fa&amp;ccedil;a amigos e se divirta!","Откройте для себя новых людей, создавайте связи и заводите новых друзей.","Descubre nuevas personas, haz nuevas conexiones y nuevos contactos.","Yeni insanlarla keşfedin, yeni bağlantılar oluşturmak ve yeni arkadaşlar.","发现新的人,建立新的联系,结交新的朋友"),
