("549","showlastseen_help","","if you don&#039;t share your last seen , you won&#039;t be able to see other people last seen.","اذا لم تشارك اخر ظهور لك , فانك لن تكون قادرا على رؤية اخر ظهور المستخدمين.","als je het niet eens met je voor het laatst gezien, zult u niet in staat zijn om andere mensen het laatst gezien.","si vous ne partagez pas votre dernière fois, vous ne serez pas en mesure de voir d&#39;autres personnes la dernière fois.","wenn du nicht teilen willst was du dir als letztes angesehen hast, kannst Du auch nicht sehen was andere sich angesehen haben.","se non si condivide il visto l&#039;ultima volta, non sarà in grado di vedere altre persone visto l&#039;ultima volta.","Se voc&amp;ecirc; N&amp;atilde;o compartilhar a &amp;uacute;ltima vez que voc&amp;ecirc; foi visto, voc&amp;ecirc; tamb&amp;eacute;m N&amp;atilde;o poder&amp;aacute; ver a ultima vez que os outros usu&amp;uacute;rios foram vistos.","Если отключить это уведомление, вы не сможете видеть последнее подключение других пользователей..","Si desactivas esta notificación tu tampoco podrás ver la conexión de otros usuarios.","Eğer son görüldüğü paylaşmak yoksa, son görüldüğü diğer insanları görmek mümkün olmayacaktır.","如果你不分享你最后一次见到的人,你将无法看到其他人最后一次见到"),
